from imageai.Classification import ImageClassification
import os
import time
from flask import Flask, request

import base64
from PIL import Image
from IPython.display import Image 
from PIL import Image
from io import BytesIO
import base64
execution_path = os.getcwd()

prediction = ImageClassification()
prediction.setModelTypeAsMobileNetV2()
prediction.setModelPath(os.path.join(execution_path, "mobilenet_v2.h5"))
prediction.loadModel()



app = Flask(__name__)

@app.route('/',methods=['POST'])
def picture():
    # data = ""
    res=request.get_json()
    data = res['given']
    im = Image.open(BytesIO(base64.b64decode(data)))
    display(im)
    start_time = time.time() 
    width, height = im.size 
    print(im.size)

    # Setting the points for cropped image 
    left = 0
    top = height / 2.2
    right = width
    bottom = 3 * height / 5.2

    # Cropped image of above dimension 
    # (It will not change orginal image) 
    im1 = im.crop((left, top, right, bottom)) 
    print(im1.size)
    # print("--- %s seconds ---" % (time.time() - start_time))
    # Shows the image in image viewer  
    display(im1)
    im1 = im1.save("image.jpg") 
    predictions, probabilities = prediction.classifyImage(os.path.join(execution_path, "image.jpeg"), result_count=10)
    for eachPrediction, eachProbability in zip(predictions, probabilities):
        print(eachPrediction , " : " , eachProbability)
    return "received Image"
if __name__ == '__main__':
    app.run(host="0.0.0.0", port="5000", debug=False)


